import React from 'react';
import Layout from './Layout';
import Welcome from '../components/Welcome';

const Dashboard = () => {
	return (
		<Layout>
			<div className="container-md mt-5">
				<div className="container-dash"></div>
			</div>
		</Layout>
	);
};

export default Dashboard;
